INSERT INTO `catalog_pages` (`id`, `parent_id`, `caption`, `icon_image`, `visible`, `enabled`, `min_rank`, `min_vip`, `order_num`, `page_link`, `page_layout`, `page_strings_1`, `page_strings_2`) VALUES
	(0, -1, 'Front Page', 213, '1', '1', 1, 0, 1, 'frontpage', 'frontpage4', 'catalog_frontpage_headline_shop_GENERAL|frontpage_teaser', '<i><b><font color="#0E668C" size="16">What can I find in the shop?</font></b></i><br><br>Upgrade your clothing with Habbo Club, adopt a pet or decorate your room the way you like it. Whatever you like to do most in Habbo, you\'ll find a way to make that experience even better by browsing our Shop.<br><br><li>Join <a href="event:catalog/open/habbo_club">Habbo Club</a></li><li><a href="event:catalog/open/set_pixelnew">Decorate </a>your room</li><li>Adopt a <a href="event:catalog/open/pet_horse">Pet</a>, <a href="event:catalog/open/bots">Bot</a> or <a href="event:catalog/open/monster_plants_info">Monsterplants</a></li><li>Make your own <a href="event:catalog/open/category_wired">Wired</a> games </li><li>Trade in our <a href="event:catalog/open/marketplace_offers">Marketplace</a></li><br><i><b><font color="#0E668C" size="16">Where can I get credits?</font></b></i><br><br>We have many methods of payment such as SMS, Home Phone, Prepaid Cards, and Credit Cards.<br><br><a href="event:habblet/open/credits">Visit our credits page for more info.</a>|Redeem a voucher code here:'),
	(1, 282, 'Classic Furni', 2, '0', '0', 1, 0, 14, '', 'default_3x3', 'catalog_frontpage_headline2_en|', '|'),
	(2, 282, 'Pixel Shop', 5, '0', '1', 1, 0, 24, '', 'default_3x3', 'catalog_frontpage_headline2_en|', '|'),
	(3, 282, 'Habbo Club', 172, '1', '1', 1, 0, 3, 'habbo_club', 'recycler_info', 'habboclub_2|VIP_badge', 'Habbo Club is free and you get in when you start. Although you can buy VIP read more about that below.|VIP is avaliable from Habbo.com/store/vip for $40USD\\r\\r\r\nYou get the following features with VIP:\\r\r\nPush/Pull commands, VIP Catalogue including cool rares\\r\r\nand heaps of cool other features. So why not get it now?\\r'),
	(4, 282, 'Silver VIP', 196, '1', '1', 1, 1, 30, '', 'default_3x3', 'vipheader1|vipteaser2', 'Thank you for purchasing VIP! This section of the catalogue is especially for our VIP users. The Rares in this section aren\'t cheap, but you can sell them on to non VIP members for a much heftier price!|Click on an item for more information.'),
	(5, 3, 'Buy Club', 75, '0', '1', 1, 0, 3, '', 'default_3x3', 'habboclub|catalog_hc_teaser', 'Habbo club comes with many bonuses! More hair and clothes choices, more hair and clothes colours to come from, new room layouts, new dances, and much, much more!|'),
	(6, 3, 'Club Shop', 172, '1', '1', 1, 0, 20, '', 'default_3x3', 'catalog_header_hc|hc_catalog_teaser', 'As a member of Habbo Club you can shop from this selection of exclusive items.'),
	(7, 282, 'Bots', 65, '1', '1', 1, 0, 16, 'bots', 'bots', 'catalog_bots_headline1_en|catalog_bots_headline1_en', 'They walk, they talk, and they make the perfect addition to any room!|Choose a bot of your fancy!\\nNote: You can customise your bot once its in your room'),
	(8, 282, 'Marketplace', 69, '0', '1', 1, 0, 27, '', 'pets3', 'catalog_marketplace_header_en|catalog_note_marketplace', 'The Habbo Marketplace is a convenient and safe way to buy and sell items in Habbo.|How does the Habbo Marketplace work?|Selling items: You can sell any item which is tradable by selecting the item in your inventory and clicking on "Sell in Marketplace". You can also use items currently in the shop.\r\n\r\nBuying items: Browse for the item you want to buy on the Marketplace Offers page and click Buy. We guarantee you\'ll get the item at the cheapest price available at the moment of purchase.|'),
	(9, 8, 'My Sales', 70, '1', '1', 1, 0, 1, '', 'marketplace_own_items', '', ''),
	(10, 8, 'Offers', 71, '1', '1', 1, 0, 2, 'marketplace_offers', 'marketplace', '', ''),
	(11, 282, 'Habbo Exchange', 146, '1', '1', 1, 0, 1, '', 'default_3x3', 'catalog_bank_headline1|catalog_bank_teaser', 'You can exchange your Habbocredits here for Exchange furniture, which you can use in a trade or simply exchange for actual credits.|'),
	(12, -1, 'Pet Shop', 8, '1', '1', 1, 0, 3, 'pets_shop', 'pets3', 'catalog_pet_headline1|ctlg_pet_note', 'Pets are inhabitants of Habbo Hotel too so each pet owner needs to know a bit about them. If you want to look after your pet properly, make sure you read the following points carefully.|A few things you should know:|*You can place a pet in your room or take one for a walk with you in other rooms.\r\n*You can\'t trade your pet but they can follow you to friend\'s rooms to gather scratches.\r\n*You can have up to 50 pets in your room, but look after them all!\r\n\r\n\r\n*Look after your pet with food, water and treats. Check the Pets\' Accessories.\r\n*Unlock Badges and Achievements by Training your Pet.|Click your Pet and hit the "Train" button to get a list of commands that will level up your Pet in no time!'),
	(13, 176, 'Spaces', 225, '1', '1', 1, 0, 14, 'set_pixelnew', 'spaces_new', 'catalog_spaces_headline1|', 'Floors, wallpapers and landscapes - get a groovy combination for your room! Use our sample room below to try before you buy! Select your favourite designs and colours and simply click Buy!|'),
	(14, 282, 'Limited Rares', 145, '1', '1', 1, 0, 9, '', 'default_3x3', 'limited_header|', 'Get them while they\'re hot! Limited Edition Rare Furni is only available in limited quantities and once we\'ve sold out, they\'re gone! Each furni can be identified by its unique ID number and the LTD logo beside them!|'),
	(15, 282, 'New Furni', 2, '0', '0', 1, 0, 12, '', 'default_3x3', 'catalog_frontpage_headline2_en|', '|'),
	(16, 177, 'Cinema 2013', 136, '1', '1', 1, 0, 54, '', 'default_3x3', 'cinema_catalogheader|movie_catalog_teaser', 'All the way from Habbowood... Everything you could need and more to create your very own movie magic in a home theatre!|'),
	(17, -1, 'Clothing', 74, '1', '1', 1, 0, 4, 'clothing', 'default_3x3', 'clothing_catalog_header|tradeableclothing_teaser', 'The all NEW Habbo Couture tradeable clothing and accessories range is a cut above the rest! From stylish tops and jeans, to amazing accessories and hair; Habbo Couture lets you express yourself to the extreme!'),
	(18, 9049, 'Gnomes', 200, '1', '1', 1, 0, 5, 'xmas14_gnome', 'default_3x3', 'xmas14_catalog_header|xmas14_gnome_teaser', 'The North Pole can be a tough place for a little Gnome, so this year they\'ve migrated to the sunny shores of Habbo Islands. Feed them, train them and treate them with care...'),
	(19, 177, 'New Years 2015', 2014, '1', '1', 1, 0, 156, '', 'default_3x3', '2015_header|catalog_2015_header', ''),
	(20, 176, 'Windows', 218, '1', '1', 1, 0, 20, '', 'default_3x3', 'ctlg_windows_headline1_en|ctlg_windows_teaser1_en', 'Let some light in! Our windows come in many unique styles to give an exciting look to your room. Buy landscapes to go with your windows from the \'Spaces\' page!|'),
	(21, 176, 'Moodlights', 40, '1', '1', 1, 0, 4, '', 'default_3x3', 'catalog_dimmers_header_en|dimmers_teaser', 'Our range of moodlights allow you to control the atmosphere and transform your room in just a click. What will your room look like? Click the switch and find out now!|'),
	(22, 177, 'Christmas', 168, '1', '1', 1, 0, 56, '', 'default_3x3', 'catalog_xmas_headline1|xmas2009_catalogue', 'Get yourself into the Christmas spirit with our selection of festive furni! From baubles to reindeer poo, we\'ve got it all!|'),
	(23, 177, 'Arctic', 13, '1', '1', 1, 0, 14, '', 'default_3x3', 'catalog_arc_header1_en|catalog_arc_teaser1_en', 'Stay cool (or warm with our campfire!) and create your own Winter Wonderland or Humble Homeland for your penguins.|'),
	(24, 176, 'Teleporters', 120, '1', '1', 1, 0, 16, '', 'default_3x3', 'catalog_doors_headline1|catalog_teaser_teleporters', 'Take your room to a whole new level with our range of space age teleporters! Just buy a pair, put one in each room and voila! You\'ll have two linked rooms!|'),
	(25, 177, 'Mode', 39, '1', '1', 1, 0, 144, '', 'default_3x3', 'catalog_mode_headline1|catalog_mode_teaser1', 'Steely, grey, industrial standard metal with a sleek design. The perfect range for a streetwise city dweller.|'),
	(26, 177, 'Candy', 19, '1', '1', 1, 0, 42, '', 'default_3x3', 'catalog_candy_headline1|catalog_candy_teaser1', 'A bit more feminine than \'Mode\', this will add a bit of glamour and glitz to your rooms. Lacking a few items? Head on over to the \'Mode\' category!|'),
	(27, 177, 'Pura', 48, '1', '1', 1, 0, 176, '', 'default_3x3', 'puraheader|catalog_pura_teaser1', 'The cleanest, freshest range. You can almost hear it breathe cool and tranquility within your room. Use it to create a haven away from the hectic lifestyle of Habbo Hotel.|'),
	(28, 177, 'Area', 14, '1', '1', 1, 0, 16, '', 'default_3x3', 'catalog_area_headline1|catalog_area_teaser1', 'A chunky and sofisticated line for the down-to-earth, studious Habbo. Its simplicty is beautful and will add a welcoming charm to every room.|'),
	(29, 177, 'Country', 21, '1', '1', 1, 0, 68, '', 'default_3x3', 'country_header1_en_001|country_teaser1', 'Let\'s leave the busy city streets and head over to the wide abyss of golden wheat, emerald fields and home grown, organic vegetables. Everything you need to create a farm!|'),
	(30, 177, 'Lodge', 37, '1', '1', 1, 0, 130, '', 'default_3x3', 'catalog_lodge_headline1|catalog_lodge_teaser1', 'For that splendid ski-lodge effect with an open fire and whisky on the sidebar. This range is for those who appreicate the true beauty of solid wood.|'),
	(31, 177, 'Plastic', 46, '1', '1', 1, 0, 168, '', 'default_3x3', 'catalog_plasto_headline1|', 'Throw on an afro and grab a disco ball! Feel that retro, 1970s vibe? You soon will with this colourful, plastic range! Choose a colour to suit your mood and off you go!|'),
	(32, 177, 'Lagomorph', 192, '1', '1', 1, 0, 126, '', 'default_3x3', 'catalog_header_easter14_001|catalog_lagomorph_teaser', 'From shape shifting wall pieces to crpytic teleports, the isle of Lagomorph furni line is sure to keep you guessing! Nothing is as it seems on this mind-bending island...'),
	(33, 177, 'Bathroom', 17, '1', '1', 1, 0, 26, '', 'default_3x3', 'catalog_bath_headline1|catalog_bath_teaser1', 'Lets face it.. you can\'t live without your bathroom. Give your guests somewhere to freshen up with our cheeful bathroom collection!|'),
	(34, 176, 'Plants', 220, '1', '1', 1, 0, 6, '', 'default_3x3', 'catalog_plants_headline1|catalog_plants_teaser1', 'Every room needs some greenery, dear! Not only do they enhance the air quality, they cheer up a room to make it simply splendid! And what better gift for a friend than an elegant rose..|'),
	(35, 176, 'Rugs', 116, '1', '1', 1, 0, 12, '', 'default_3x3', 'catalog_rugs_headline1|catalog_rugs_teaser1', 'Rugs for all occasions, white for weddings, black for funerals and everything in between! All rugs are non-slip and machine washable. Take your pick!|'),
	(36, 176, 'Wall Decorations', 219, '1', '1', 1, 0, 8, '', 'default_3x3', 'catalog_gallery_headline1|catalog_posters_teaser1', 'Adorn your walls with posters, art, plaques and wall hangings. This gallery is bursting with items to suit all tastes, traditional and modern!|'),
	(37, 177, 'Trophies', 60, '1', '1', 1, 0, 210, '', 'trophies', 'catalog_trophies_headline1|', 'Everyones a winner with Habbo trophies! Now you can reward all your friends with our pre-polished array of trohpies, in bronze, silver and gold. \r\nFirst choose your trophy model, then the metal, and carefully type your inscription. Don\'t worry, we\'ll engrave it all with your name and the date.|'),
	(38, 177, 'Accessories', 11, '1', '1', 1, 0, 2, '', 'default_3x3', 'catalog_extra_headline1|catalog_extra_teaser1', 'However you like to place your essentials, its the finishing touches that really make a room and express your true personality. Don\'t forget, like anything else, you can move them all about to suit your mood!|'),
	(39, 2, 'Rentals', 44, '1', '1', 1, 0, 230, '', 'default_3x3', 'catalog_pixelrent_headline1_en|catalog_pxl_teaser3_en', 'Hire some cool effects to add an explosive touch to your room. From bubbles to firestarters, you can enhance your room dramatically!|'),
	(40, 3, 'HC Executive', 172, '1', '1', 1, 0, 51, '', 'default_3x3', 'catalog_header_hc|hcexec_teaser', 'Habbo Club is back! With a new range of furniture; HC Executive!'),
	(41, 177, 'Base', 179, '1', '1', 1, 0, 24, '', 'default_3x3', 'catalog_header_base|base_rentable_teaser', 'This colourful range of furni has everything you need to style out your room and build great spaces.'),
	(42, 177, 'Health Spa', 211, '1', '1', 1, 0, 112, '', 'default_3x3', 'catalog_header_spa|catalog_teaser_spa', 'A day at the spa! Inhale...Exhale...Inhale...Exhale. With all the features of a premium Spa, you can now create your very own Habbo Health Spa relaxing retreat! Robe and slippers not included.'),
	(43, 177, 'Shakespeare', 59, '1', '1', 1, 0, 190, '', 'default_3x3', 'catalog_shakespeare_header|catalog_shakespeare_teaser', 'You can be the world\'s most famous poet! All you need to do is purchase the furniture below, be amazing at speaking and drink tea!'),
	(44, 282, 'Duckets Shop', 178, '1', '1', 1, 0, 13, '', 'info_duckets', 'duckets_header|', '<i><b><font color="#591d97" size="16">What are Duckets?</font></b></i><br><br>Ducket is a free virtual currency you can earn daily just by playing Habbo.<br><br><i><b><font color="#591d97" size="16">What are they good for?</font></b></i><br><br><li><a href="event:catalog/open/rentables_spaces">Paint</a>  your rooms.</li><li>Get a <a href="event:catalog/open/duckets_cat">cat</a> and <a href="event:catalog/open/duckets_petaccessories">accessories</a>.</li><li><a href="event:catalog/open/rentables_info">Rent furniture</a>.</li><li>Get <a href="event:catalog/open/special_effects">avatar effects</a>.</li><li>Whatever fun stuff we come up with.</li><br><i><b><font color="#591d97" size="16">How can I get them?</font></b></i><br><br><li>Visit Habbo! Get some every day. The more active you are, the more you\'ll earn.</li><li>You get some for each completed achievement in the <a href="event:talent/open/citizenship">Citizenship track</a>.</li><li>Any other surprise we might come up with!</li>|'),
	(45, 182, 'Extras', 28, '1', '1', 1, 0, 36, '', 'default_3x3', '', 'Feeling creative? You should be! Here is a full range of building blocks to create a master piece with!'),
	(46, 176, 'Badge Display', 224, '1', '1', 1, 0, 2, '', 'badge_display', '|', 'Got a badge that you want to flaunt off to others? Now is your chance!'),
	(47, 44, 'Room Promo', 55, '1', '1', 1, 0, 3, 'room_ad', 'roomads', 'events_header|', '||'),
	(48, 177, 'Iced', 13, '1', '1', 1, 0, 114, '', 'default_3x3', 'catalog_iced_headline1|catalog_iced_teaser1', 'The Iced range: Squishy, soft and most definitely cool. Whatever your needs, this stylish range should cover it!|'),
	(49, 177, 'Alhambra', 12, '1', '1', 1, 0, 6, '', 'default_3x3', 'catalog_alh_headline1_en|dining_area_illustration', 'For the cold Arabian nights and hot Arabian days, you\'ll need a palace.. And we have just what you need! Green blossom print should cover it just fine!|'),
	(50, 177, 'Asian', 15, '1', '1', 1, 0, 18, '', 'default_3x3', 'catalog_asian_headline1|catalog_asian_teaser1', 'Ting tong! Ching chong? Ting chong ting, ping ping! I mean uh.. with our authentic Chinese furniture, you can make a beautiful oriental room!|'),
	(51, 177, 'Bensalem', 18, '1', '1', 1, 0, 28, '', 'default_3x3', 'catalog_lc_headline2_en|catalog_lc_teaser1_en_001', 'Under the seaaaaaaaaa, oh, Under the seaaaaaa! What will your underwater world look like? We have it all here, crabs, coral, and mythical sea creatures!|'),
	(52, 177, 'Easter 2011', 25, '1', '1', 1, 0, 80, '', 'default_3x3', 'catalog_easter_headline1|catalog_easter_teaser1', 'Little birdies hatching from their eggs, pretty, dainty flowers blooming and cute rabbits bouncy in Spring meadows.. It\'s Easter!|'),
	(53, 177, 'Executive', 27, '1', '1', 1, 0, 86, '', 'default_3x3', 'catalog_exe_headline1_en|catalog_exe_teaser_en', 'For the ultimate business man, the Executive range with its leather seats and Italian coffee is a dream! How about you try the easy lifestyle?|'),
	(54, 177, 'Glass', 29, '1', '1', 1, 0, 92, '', 'default_3x3', 'catalog_glass_headline1|catalog_glass_teaser1', 'You can really open up a space with this stylish glass furniture, just don\'t walk into it!|'),
	(55, 177, 'Gothic', 30, '1', '1', 1, 0, 94, '', 'default_3x3', 'catalog_gothic_headline1|catalog_gothic_teaser1', 'As the church bells ring out midnight, you walk through your cobbled hall lit by candles, throw yourself into your medieval throne and paint your nails black. This is what we imagined when we ordered this range!|'),
	(56, 177, 'Sports', 56, '1', '1', 1, 0, 196, '', 'default_3x3', 'sports|catalog_sports_teaser1', 'Sport contains all those vital Olympic pieces from running tracks to basketball courts! 3, 2, 1, GO!|'),
	(57, 177, 'Grunge', 32, '1', '1', 1, 0, 98, '', 'default_3x3', 'catalog_grunge_headline1|catalog_gru_teaser_en', 'Sleeping rough? Make the streets a bit more bearable with our collection of homeless furni, Grunge!|'),
	(58, 177, 'HabboWood', 33, '1', '1', 1, 0, 110, '', 'default_3x3', 'habbowood|ctlg_limited_teaser1', 'No flash photography, darling! This range is only for the VIP Hollywood actors!|'),
	(59, 177, 'Habboween 2011', 34, '1', '1', 1, 0, 102, '', 'default_3x3', 'catalog_halloween_headline1|catalog_voodoo_teaser', 'WooOOOOoooOOoo! Spooky! Don\'t wanna be left with this range at night.. who knows what would happen!|'),
	(60, 177, 'Japan', 36, '1', '1', 1, 0, 120, '', 'default_3x3', 'catalog_jap_headline1|catalog_jap_teaser3_en', 'We have sushi, tatami and katana\'s! I have no idea what the difference is, but I sure know its Japanese! Fulfil your fantasies and buy some today!|'),
	(61, 177, 'Lost Tribe', 38, '1', '1', 1, 0, 132, '', 'default_3x3', 'losttribe|LT_teaser_en', 'Start your own tribal village with our ancient furniture, all carved from hard wearing stone. NOTE: Lava is hot, get an adult to help you.|'),
	(62, 177, 'Neon', 41, '1', '1', 1, 0, 152, '', 'default_3x3', 'catalog_neon_header1_en|catalog_neon_teaser1_en', 'New years eve, birthdays and every other day of the year, there\'s always an excuse for a party! So, why don\'t you buy some Neon furni!?|'),
	(63, 177, 'Relax', 49, '1', '1', 1, 0, 180, '', 'default_3x3', 'rela_header_en|rela_teaser_en', 'Relax after a busy day in the Welcome Lounge. Light a few candles, and chill out with a good read in a wicker chair. We understand the needs of a Habbo with a hectic lifestyle!|'),
	(64, 177, 'Romantique', 50, '1', '1', 1, 0, 182, '', 'default_3x3', 'catalog_romantique_headline1|catalog_rom_teaser_en', 'Found in a French barn, this sweet but sexily romantic range caters to every ladies needs. Just going to powder my nose!|'),
	(65, 177, 'Science Fiction', 53, '1', '1', 1, 0, 188, '', 'default_3x3', 'sf_header_en|sf_teaser_en', 'Blipblop blip blip blip.. Oooh.. what\'s this button do?.. You can find out exactly what it does with our new Scifi range, batteries included!|'),
	(66, 177, 'Shalimar', 54, '1', '1', 1, 0, 192, '', 'default_3x3', 'catalog_shal_header1_en|catalog_shal_teaser_en', 'Everyone loves Bollywood! Watch out for rose petals!|'),
	(67, 177, 'Summer', 57, '1', '1', 1, 0, 204, '', 'default_3x3', 'summer|catalog_teaser_dragons', 'Phwoar! Start up the barbie! This range has everything you need for the perfect summer garden!|'),
	(68, 177, 'Valentines', 144, '1', '1', 1, 0, 220, '', 'default_3x3', 'catalog_header_val12_2_en|catalog_teaser_val12', 'Love is in the air once again! Buy your sweetheart a rose or whisper sweet nothings in their ear on a love sofa. Can you feel it? <3|'),
	(69, 177, 'Greek', 31, '1', '1', 1, 0, 96, '', 'default_3x3', 'greekheader|greekteaser', 'Be transported back to ancient Greece with a couple of thousand pounds and British Airways. Until then, build your own panthenon with our realist Greek range!|'),
	(70, 143, 'Freeze', 87, '1', '1', 1, 0, 6, '', 'default_3x3', 'catalog_cltbs_heade r1_es|catalog_cltbs_tease r_es', 'Freeze!... and try the newest game to hit Habbo! Team up and plant snowball bombs to snap freeze your competitors. You could say it\'s so cool, it\'s frozen ;)'),
	(71, 72, 'Collectibles', 28, '1', '1', 5, 0, 6, '', 'default_3x3', 'catalog_collectibles_headline1_en|catalog_cltbs_teaser_en', 'The Pixel Collectables are the ultimate collectors items, requiring a mammoth 2000 pixels and credits to buy! If you collect all the pieces and manage to put them together in certain ways, you\'ll receive a special effect!|'),
	(72, 283, 'Other Furni', 3009, '1', '1', 5, 0, 3, '', 'default_3x3', '|', '|'),
	(73, 283, 'Rare Furni', 3009, '1', '1', 5, 0, 1, '', 'default_3x3', '|', '|'),
	(74, 72, 'Trophies', 28, '1', '1', 5, 0, 210, '', 'trophies', 'catalog_trophies_headline1|', 'This page contains special trophies available for staff to give as prizes. STAFF CAUGHT GIVING OUT THESE WITH NO REASON WILL BE DEMOTED.|'),
	(75, 73, 'Rares', 28, '1', '1', 5, 0, 1, '', 'default_3x3', 'catalog_rares_headline1|raresteaser', 'Please do not give out rares to your friends or users for no reason, each purchase you make is logged for higher management to review.'),
	(76, 72, 'Room Backgrounds', 28, '1', '1', 5, 0, 3, '', 'default_3x3', 'catalog_rares_headline1|raresteaser', 'This page contains special rares available for staff. STAFF CAUGHT GIVING OUT THESE WITH NO REASON WILL BE DEMOTED.|'),
	(77, 72, 'Theatredome', 28, '1', '1', 5, 0, 12, '', 'default_3x3', '', ''),
	(78, 176, 'Rollers', 222, '1', '1', 1, 0, 10, '', 'default_3x3', 'catalog_roller_headline1|catalog_teaser_rollers_en', 'Zoooooooom, Zooooooooooooooooooooooooooom! Was it a plane? Was it a bird!? No, it was Danielle on a roller! You can use rollers in games, events or even just to move a queue along.|'),
	(79, 177, 'Diner', 204, '1', '1', 1, 0, 74, '', 'default_3x3', 'diner|catalog_diner_teaser_en', 'Originally from the 50\'s this furni has been refurbished and put right into the catalogue! Use this with the Kitchen range for ultimate diner experience!|'),
	(80, 177, 'Twilight', 64, '1', '1', 1, 0, 212, '', 'default_3x3', 'catalog_twilight_header_en|catalog_teaser_twilight', 'I\'ve never read the book, all I know is it has vampires playing basket ball and some heart throb called Edward Cullen, but the furni looks good!|'),
	(81, 143, 'Battle Banzai', 78, '1', '1', 1, 0, 2, '', 'default_3x3', 'Battlebanzai|catalog_battleBanzai_teaser', 'Prepare for Battle Banzai!|'),
	(82, 2, 'Hello', 35, '1', '1', 1, 0, 240, '', 'default_3x3', 'catalog_hello_header1_en|catalog_hello_teaser1_en', 'Hello Furni is available with Pixels and is perfect if you are decorating your room for the very first time. The Furni is yours to keep and therefore cannot be traded.|'),
	(83, 177, 'Tiki', 59, '1', '1', 1, 0, 208, '', 'default_3x3', 'catalog_tiki_header1_en|tiki_teaser', 'Imagine the scene.. lost on a desert island when you stumble across a small local tribe.. now you can with our Tiki range!|'),
	(84, 177, 'Urban', 26, '1', '1', 1, 0, 216, '', 'default_3x3', 'urban_header_en|urban_teaser_en', 'New York City styled furni range, Urban is perfect for any street, alleyway or road. Rubbish bins, street lights and benches, all the Urban furniture you need!|'),
	(85, 177, 'Automobile', 16, '1', '1', 1, 0, 22, '', 'default_3x3', 'catalog_automobile_header1_en|catalog_automobile_teaser1_en', 'Every Habboer needs a car effect! Not only do they bring a bit of the outside inside, they also enhance the air quality! And what better gift for a friend than a beautiful traffic sign or elegant pile of tires...|'),
	(86, 72, 'System', 28, '1', '1', 5, 0, 1, '', 'default_3x3', 'system1|', '|'),
	(87, 177, 'Habboween 2014', 231, '1', '1', 1, 0, 108, '', 'default_3x3', 'hween14_catalog_header|hween14_catalog_teaser', 'It\'s that time of the year again, and to celebrate the spooky month we\'ve released a new Habboweed furni range!'),
	(88, 177, 'Bling', 93, '1', '1', 1, 0, 34, '', 'default_3x3', 'catalog_header_bling_en|catalog_teaser_bling11', 'Bling, Bling! Flash, Flash! Want to have that real celebrity lifestyle? Well, go somewhere else, all we have here is a tacky range of furni.|'),
	(89, 177, 'Orgie', 235, '1', '1', 1, 0, 158, '', 'default_3x3', 'orgierange|', 'The latest range from Ann Summers, the Orgie line. Made of soft, wipe clean plastic, its perfect for any three, four or fivesome!|'),
	(90, 12, 'Pigs', 67, '1', '1', 1, 0, 20, '', 'pets', 'catalog_pet_headline1|', 'These little scamps were destined for the dining table until we struck a deal with a local farmer to rescue their cute pigtails! Adopt your little piglet today, all you need now is a name.|Name your Pig:|Pick a Colour:|Pick a breed:'),
	(91, 12, 'Pet Accessories', 43, '1', '1', 1, 0, 30, '', 'default_3x3', 'catalog_pet_headline1|ctlg_pet_teaser1', 'This page has everything you need to give your pet the happy life it deserves. We\'ve got a huge selection!|'),
	(92, 177, 'Flower Power', 73, '1', '1', 1, 0, 88, '', 'default_3x3', 'flowerpower|2828998428_1', 'Woah! Far out man... let the petals take control. Lets collaborate on a hippy hideout and plant some seeds! Lucy in the sky with diamonds style eyy?!|'),
	(93, 177, 'Runway', 74, '1', '1', 1, 0, 184, '', 'default_3x3', 'runway_header_en|runway_teaser_en', 'Spice up your salon, hair parlour or boutique with our stylish yet practical range! From sewing machines to comfy seating, we\'ve got the perfect option for you.|'),
	(94, 177, 'Wedding', 238, '1', '1', 1, 0, 232, '', 'default_3x3', 'Wedding1|9efov', 'Habbo just wouldn\'t be the same without a wedding to attend every now and again!|'),
	(95, 177, 'School', 130, '1', '1', 1, 0, 186, '', 'default_3x3', 'ruletheschool_header|catalog_school_teaser', 'Sick of being told what to do? Want to be the boss of someone else for a change? Well now you can with our very own school range!|'),
	(96, 12, 'Terriers', 66, '1', '1', 1, 0, 26, '', 'pets', 'catalog_pet_headline1|', 'Good things come in small packages and Habbo\'s Terriers are no exception!|Name your Terrier:|Pick a colour:|Pick a breed:'),
	(97, 12, 'Bears', 68, '1', '1', 1, 0, 2, '', 'pets', 'catalog_pet_headline1|', 'A large, heavy, mammal that walks on the soles of its feet, with thick fur and a very short tail. Fall in love with our adorable range of Bears that include the Grizzly and Polar varieties!|Name your Bear:|Pick a colour:|Pick a breed:|'),
	(98, 12, 'Cats', 20, '1', '1', 1, 0, 4, '', 'pets', 'catalog_pet_headline1|', 'Fluff, whiskers, meows and purrs! You\'re about to enter the world of Habbo Cats. These cute little critters make great playmates and will keep you company if you look after them well. Find a new friend from our ever-changing selection.|Name your Cat:|Pick a Colour:|Pick a breed:'),
	(99, 12, 'Dogs', 24, '1', '1', 1, 0, 10, '', 'pets', 'catalog_pet_headline1|', 'Wet noses, paws, yaps and woofs! You\'re about to enter the world of Habbo Dogs. An adorable and faithful servant awaits you with a wagging tail everytime they see you. Find a new friend from our ever-changing selection.|Name your Dog:|Pick a Colour:|Pick a breed:'),
	(100, 12, 'Crocs', 22, '1', '1', 1, 0, 8, '', 'pets', 'catalog_pet_headline1|', 'Scaly skin, growls and snaps! You\'re about to enter the world of Habbo Crocs. Security for your room or to scare your friends a trustworthy and surprisingly loving companion can be yours. Find a new friend from our ever-changing selection.|Name your Croc:|Pick a Colour:|Pick a breed:'),
	(101, 143, 'Football', 56, '1', '1', 1, 0, 4, '', 'default_3x3', 'WorldCup|worldcup_teaser', 'This furni range is a must have for any football fanatic!|'),
	(102, 177, 'Prison', 240, '1', '1', 1, 0, 170, '', 'default_3x3', 'prisonheader|prisonteaser', 'Hey, he\'s escaping! Just kidding, no one\'s getting out of these high security cells!|'),
