	(104, 12, 'Lion', 76, '1', '1', 1, 0, 16, '', 'pets', 'catalog_pet_headline1|', 'Simba, is that you? Oh wait, it\'s just one of Habbo\'s adorable pet lions! Unlike real ones, these won\'t bite your arms off. And hey, now you can tell all those girls that you\'re a lion tamer, it\'s not technically lying!|Name your Lion:|Choose a colour:|Choose a breed:'),
