	(106, 12, 'Spider', 95, '1', '1', 1, 0, 24, '', 'pets', 'catalog_pet_headline1|', 'One of the most feared creatures in nature, and perhaps the most misunderstood. The majority of Spiders are predators with sharp fangs that inject venom into their prey- but dont worry, these spiders wont bite you! Maybe...||Name your Spider:|Select your colour/breed:'),
	(107, 12, 'Frog', 97, '1', '1', 1, 0, 14, '', 'pets', 'catalog_pet_headline1|', 'The Frog. Cute, green and slimy! Frogs come in a variety of weird colours and can be found all over the world. Frogs are great jumpers, and make great pets, but are harder to hold onto than a supermodel in a tornado.||Name your Frog:|Select your colour/Breed:'),
	(108, 12, 'Chick', 107, '1', '1', 1, 0, 6, '', 'pets', 'catalog_pet_headline1|', 'Habbo is full of chicks (the pet kind!) Adopt your new born chicklet now and start training it to perform the Chicken Dance for your friends... it will be a show to remember!||Name your chick:|Pick a colour/breed:|'),
