	(255, 177, 'Military', 259, '1', '1', 1, 0, 140, '', 'default_3x3', 'army_header|army_teaser', 'Purchase the new in stock army/military based furni - from gun racks to choppers, no matter what item you\'re after; this section will have it!'),
